import { HiTrash } from "react-icons/hi";

const NoteContent = ({ noteContent }) => {
    return (
        <>
         <div className="note-box">
            <h2>{noteContent.title}</h2>
            <p className="textPreview">{noteContent.contentText}</p> 
            <button></button>
        </div>
        </>
    )
}

export default NoteContent;
